import React from "react";

export default function practiceHeader(){
    return(
        <header className="header">
            <strong>Header</strong>
            <ul>
                <li>
                    <button>Home</button>
                </li>
                <li>
                    <a href=''>MyPage</a>
                </li>
            </ul>
        </header>
    );
}
